import instence from "./axios-instance";

export const usersApi = {
  getUsers: (currentPage,pageSize) =>{
    return instence.get(`users?count=${pageSize}&page=${currentPage}`,
    {
      withCredentials: true
    }).then(response => response.data)
}
}
